import Vue from 'vue'
import App from './App.vue'

import './assets/common.css'
import axios from 'axios'
// 挂载到原型链 组件可直接使用this.axios
Vue.prototype.$http = axios

Vue.config.productionTip = false

new Vue({
  render: h => h(App)
}).$mount('#app')
